from selenium import webdriver
from webdriver_manager.chrome import ChromeDriverManager
import time

class Tinderbot:
    def __init__(self):
        self.bot = webdriver.Chrome(ChromeDriverManager().install())

    def login(self):
        print('STARTUJEMY')
        time.sleep(2)
        print("LOGOWANIE...")
        print("Wpisz nazwę użytkownika:")
        usernm = input()
        print("Wpisz hasło:")
        passwd = input()
        bot = self.bot
        bot.get('https://passport.yandex.eu/auth?origin=maps&retpath=https%3A%2F%2Fyandex.eu%2Fmaps%2Fprofile%3Fll%3D10.854186%252C49.182076%26z%3D4')
        username = bot.find_element_by_id('passp-field-login')
        username.clear()
        username.send_keys(usernm)
        bot.find_element_by_id('passp:sign-in').click()
        time.sleep(5)
        password = bot.find_element_by_id('passp-field-passwd')
        password.clear()
        password.send_keys(passwd)
        bot.find_element_by_id('passp:sign-in').click()
        time.sleep(5)

